/**
 * @title AI-generated NFT
 * @author Uladzimir Kireyeu
 * @notice ERC721 compatible contract to prove owning
 * generated picture
 * @dev To mint one would need a signature
 * from the server, it is done to restrict nfts only to
 * ai-generated images
